import React from 'react';
import './Banner.css';
import banner_img from '../assets/frontend_assets/Main_Banner.png';


const Banner = () => {
    return (
        <div className='main-banner'>
            <img src={banner_img} alt="" />
        </div>
    );
};

export default Banner;
